import React, { useEffect, useState } from "react";
import axios from "axios";

const Booking = () => {
  const [order, setOrder] = useState({});
  const [paymentDetails, setPaymentDetails] = useState({});
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    const fetchPaymentData = async () => {
      try {
        const response = await axios.get(
          "http://localhost:8000/medical_store_app/payment_details/"
        );
        console.log("API Response: ", response.data); // Log the response data

        // Set order and paymentDetails (first item of the array)
        setOrder(response.data.order || {});
        setPaymentDetails(response.data.paymentDetails[0] || {});
      } catch (error) {
        console.error("Error fetching payment details:", error);
      } finally {
        setLoading(false);
      }
    };

    fetchPaymentData();
  }, []);

  if (loading) {
    return <p style={styles.loadingStyle}>Loading booking details...</p>;
  }

  // Check if the data is available
  const isDataAvailable = Object.keys(order).length > 0 && Object.keys(paymentDetails).length > 0;

  return (
    <div style={styles.containerStyle}>
      <h1 style={styles.titleStyle}>Booking Details</h1>
      {!isDataAvailable ? (
        <p style={styles.errorStyle}>No booking details available.</p>
      ) : (
        <table style={styles.tableStyle}>
          <thead>
            <tr>
              <th style={styles.headerStyle}>Field</th>
              <th style={styles.headerStyle}>Value</th>
            </tr>
          </thead>
          <tbody>
            <tr>
              <td style={styles.cellStyle}>Order ID</td>
              <td style={styles.cellStyle}>{order.id || "N/A"}</td>
            </tr>
            <tr>
              <td style={styles.cellStyle}>Total Price</td>
              <td style={styles.cellStyle}>
                ₹{order.amount ? (order.amount / 100).toFixed(2) : "N/A"}
              </td>
            </tr>
            <tr>
              <td style={styles.cellStyle}>Payment ID</td>
              <td style={styles.cellStyle}>{paymentDetails.razorpay_payment_id || "N/A"}</td>
            </tr>
            <tr>
              <td style={styles.cellStyle}>Order ID</td>
              <td style={styles.cellStyle}>{paymentDetails.razorpay_order_id || "N/A"}</td>
            </tr>
            <tr>
              <td style={styles.cellStyle}>Amount Paid</td>
              <td style={styles.cellStyle}>
                ₹{paymentDetails.amount ? (paymentDetails.amount).toFixed(2) : "N/A"}
              </td>
            </tr>
            <tr>
              <td style={styles.cellStyle}>Signature</td>
              <td style={styles.cellStyle}>{paymentDetails.razorpay_signature || "N/A"}</td>
            </tr>
          </tbody>
        </table>
      )}
    </div>
  );
};

const styles = {
  containerStyle: {
    padding: "40px",
    fontFamily: "'Segoe UI', Tahoma, Geneva, Verdana, sans-serif",
    backgroundColor: "#f9f9f9",
    minHeight: "100vh",
  },
  titleStyle: {
    textAlign: "center",
    marginBottom: "20px",
    color: "#333",
    fontSize: "24px",
  },
  tableStyle: {
    width: "100%",
    borderCollapse: "collapse",
    backgroundColor: "white",
    boxShadow: "0 4px 8px rgba(0, 0, 0, 0.1)",
    borderRadius: "8px",
    overflow: "hidden",
  },
  headerStyle: {
    backgroundColor: "#007bff",
    color: "white",
    padding: "15px",
    textAlign: "left",
    fontWeight: "bold",
    borderBottom: "2px solid #ddd",
  },
  cellStyle: {
    padding: "15px",
    borderBottom: "1px solid #ddd",
    color: "#333",
    textAlign: "left",
  },
  loadingStyle: {
    textAlign: "center",
    color: "#888",
    fontSize: "18px",
  },
  errorStyle: {
    textAlign: "center",
    color: "red",
    fontSize: "18px",
  },
};

export default Booking;
